import { Container, Row, Col, Image } from 'react-bootstrap';
import ScrollAnimation from 'react-animate-on-scroll';

const CenterPanel = (props) => (
    <Container style={{paddingTop:90,paddingBottom:90}}>

        <div style={{ display: "flex", textAlign: "center", justifyContent: "center", alignItems: "center", height: "100%", color: "white" }}>
            <div>
                <ScrollAnimation animateIn="flipInX" animateOnce="true" offset="50" delay="500">
                    <h1>{props.header}</h1>
                </ScrollAnimation>

                <ScrollAnimation animateIn="flipInX" animateOnce="true" offset="50" delay="1500">
                    <p>{props.body}</p>
                </ScrollAnimation>

            </div>
        </div>
    </Container>


);
export default CenterPanel;
